import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';

const PrivateRoute = () => {
    const token = localStorage.getItem('token'); // Check if token is present in localStorage
    const isAuthenticated = token !== null; // If token is present, user is authenticated

    // If user is authenticated, return an outlet that will render child elements
    // If not, return element that will navigate to /patientlogin
    return isAuthenticated ? <Outlet /> : <Navigate to="/patientlogin" />;
}

export default PrivateRoute;
